import React from 'react';
import "../hojas-de-estilo/Articulos.css";



const Articulos = ({cantidad}) =>{
let suma = 0;
if(cantidad.variable>0){
  suma = suma + cantidad.variable;
}
  return(
    <div className='con_articulos'>
      <div className='con_articulos_titulo'>
        <span>Cart</span>
      </div>
      <div className='con_articulos_lista'>
        {suma?<div className='empty'><span>hay {suma} elementos</span></div>:<div className='empty'><span>Your cart is empty.</span></div>
        }
        
        
      </div>
    </div>
  );
}

export default Articulos;
